There are five economic sectors involved in creating video games as products or resources, or that possess the IPTC Newscode mediatopic/20000252:

1) The game development sector, which comprises companies and individuals engaged in the creation of video games;

2) The game publishing sector, which comprises companies that finance and market video games;

3) The game retail sector, which comprises companies that sell video games to consumers;

4) The game platform sector, which comprises companies that develop and operate video game consoles and other platforms on which video games can be played; and

5) The game industry association sector, which comprises trade associations that represent the interests of the video game industry.
